import React from "react";
import { Button, Form, FormGroup, Label, Input, FormText } from "reactstrap";
import MovieList from "./movieList";
import StarRating from "./rateComponent";
import AddMovie from "./addMovie";
const movieList = [
  {
    title: "Fight club",
    image: {
      url:
        "data:image/jpeg;base64,"
    },
    rating: 4
  },
  {
    title: "American history",
    image: {
      url:
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQugQvtNQUIgThADH3yFEhzvgjo2EwJymyuKdIURjLrwFKTKTYn5A"
    },
    rating: 3
  },
  {
    title: "Jhon Wick",
    image: {
      url:
        "data:image/jpeg;base64,"
    },
    rating: 2
  },
  {
    title: "Millenium",
    image: {
      url:
        "data:image/jpeg;base64,"
    },
    rating: 1
  },
  {
    title: "Shutter Island",
    image: {
      url:
        "data:image/jpeg;base64,"
    },
    rating: 1
  }
];

const filterMovies = (movie, searchTerm, minRate) => {
  return (
    movie.title.toLowerCase().includes(searchTerm.toLowerCase()) &&
    movie.rating >= Number(minRate)
  );
};

class MovieContainer extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      movieList: movieList,
      searchTerm: "",
      searchRate: 0
    };
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
    this.handleClick = this.handleClick.bind(this);
  }

  addMovie = (title, image, rating) => {
    let tab = this.state.movieList.slice();

    let movie = {
      title: title,
      image: { src: image },
      rating: rating
    };
    tab.push(movie);
    this.setState({
      movieList: tab
    });
  };

  handleChange(event) {
    this.setState({
      [event.target.name]: event.target.value
    });
  }

  handleSubmit(event) {
    alert("A name was submitted: " + this.state.movieName);

    this.setState({
      [event.target.name]: event.target.value
    });

    event.preventDefault();
  }

  handleClick(event) {
    this.setState({
      [event.target.name]: event.target.value
    });
  }

  changeRate = rate => {
    this.setState({
      searchRate: rate
    });
  };

  render() {
    return (
      <div className="col-lg-12 border movie-container">
        <div className="row">
          <div className="col-lg-10">
            <form onSubmit={this.handleSubmit} className="row ">
              <div className="col-lg-8">
                <FormGroup className="mt-2">
                  <Input
                    onChange={this.handleChange}
                    value={this.state.searchTerm}
                    type="text"
                    name="searchTerm"
                    placeholder="type movie name to shearch..."
                  />
                </FormGroup>
              </div>
              <div className="col-lg-2">
                <button type="submit" className="btn btn-secondary mt-2">
                  Search
                </button>
              </div>
              <div className="col-lg-2 mt-2 rating">
                {/* <input
                  onChange={this.handleChange}
                  value={this.state.searchRate}
                  type="text"
                  name="searchRate"
                  placeholder="minimum rate"
                /> */}
                <StarRating
                  rating={this.state.searchRate}
                  //value={this.state.searchRate}
                  name="searchRate"
                  rate={this.changeRate}
                />
              </div>
            </form>
          </div>
        </div>
        <AddMovie buttonLabel="add Movie" addMovie={this.addMovie} />
        <div className="row">
          <div className="col-lg-12">
            <MovieList
              movieList={this.state.movieList.filter(el =>
                filterMovies(el, this.state.searchTerm, this.state.searchRate)
              )}
            />
          </div>
        </div>
      </div> // movie-container
    );
  }
}

export default MovieContainer;
